  const data = shop.reduce(
    (acc, curr) => {
      return {
        count: acc.count + curr.count,
        sum: acc.sum + curr.price * curr.count
      };
    },
    { count: 0, sum: 0 }
  );

  return {
    count: data.count,
    avg: (data.sum / data.count).toFixed(2),
    sum: data.sum.toFixed(2)
  };
};
